svg.script:
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	
	window.onSVGLoad=initLater();
		function initLater() {
     	//this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
		window.setTimeout("init1()",0);

     	window.setTimeout("init2()",3000);
		window.setTimeout("init2()",7000);
		window.setTimeout("init2()",10000);
    }

	
	function init1(){
	var zt=document.getElementById("zt");
		var child = zt.firstChild;
		while (child != null) {
				child.addEventListener("mouseover", Highlight, false);
				child.addEventListener("mouseout", HighlightRecover, false);	
				child = child.nextSibling;
			}
	}
	function init2() {
		
	    /* 添加tooltip*/
        //tooltip styles
        var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":1100};
        var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
        myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
        //add tooltip to element
		myMapApp.addTooltip("zt",undefined,true,false,"target","name");
		
		
	}
	
	function Highlight(evt) {
			var obj = evt.target;
			obc=obj.getAttributeNS(null,"class");
	//		alert(obc);
	        obj.setAttributeNS(null,"class", "fil50");
	}
	 //鼠标移开后恢复
	function HighlightRecover(evt) {
			var obj = evt.target;
			obj.class=obc;
	//		alert(obc);
			obj.setAttributeNS(null,"class", obc);
	}
	 function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style","visibility:hidden");
	}
